import React from "react";
import { useNavigate, useLocation } from "react-router-dom";
import PaymentsHistoryListnStyles from "./PaymentsHistoryList.module.scss";
import PaymentItem from "../PaymentItem/PaymentItem"

interface iPaymentsHistoryListProps {
  title: string;
}

const PaymentsHistoryList = ({ title }: iPaymentsHistoryListProps) => {
  return (
    <div className={PaymentsHistoryListnStyles.historyListWrapper}>
      <h1>{title}</h1>
      <input type="search" />
      <ul>
        <li>
          <PaymentItem cashback={true} />
        </li>

      </ul>
    </div>
  );
};

export default PaymentsHistoryList;
